import React from 'react';
import { Box, Typography, Avatar, IconButton } from '@mui/material';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
import InstagramIcon from '@mui/icons-material/Instagram';

const About = () => {
  return (
    <Box
      sx={{
        minHeight: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        bgcolor: '#e6f2f0',
        p: 4,
      }}
    >
      <Box
        sx={{
          display: 'flex',
          width: { xs: '100%', sm: '90%', md: '70%' },
          minHeight: '500px',
          boxShadow: 6,
          borderRadius: 4,
          overflow: 'hidden',
        }}
      >
        {/* Sol (yeşil gradyan) kısım */}
        <Box
          sx={{
            width: '30%',
            bgcolor: 'linear-gradient(to bottom, #7ed957, #28a745)',
            background: 'linear-gradient(to bottom, #7ed957, #28a745)',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            p: 2,
            position: 'relative',
          }}
        >
          <Avatar
            src="asd.jpg"
            alt="Yakup Şimşek"
            sx={{ width: 150, height: 150, mb: 2, border: '3px solid white' }}
          />
          <Typography variant="h4" sx={{ color: 'white', mb: 5, textAlign: 'center' }}>
            Yakup Şimşek
          </Typography>
          <Box>
            <IconButton color="inherit"><LinkedInIcon sx={{ color: 'white' }} /></IconButton>
            <IconButton color="inherit"><GitHubIcon sx={{ color: 'white' }} /></IconButton>
            <IconButton color="inherit"><InstagramIcon sx={{ color: 'white' }} /></IconButton>
          </Box>
        </Box>

        {/* Sağ (beyaz) kısım */}
        <Box
          sx={{
            width: '70%',
            bgcolor: 'white',
            p: 4,
            borderTopLeftRadius: 40,
            borderBottomLeftRadius: 40,
            ml: '-30px',
            zIndex: 1,
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'center',
          }}
        >
          <Typography variant="h5" sx={{ fontWeight: 'bold', mb: 1 }}>
            Yakup Şimşek
          </Typography>
          <Typography variant="subtitle1" sx={{ color: '#555', mb: 2 }}>
            Eğitim Teknoloğu
          </Typography>
          <Typography variant="body1" sx={{ color: '#333', mb: 4 }}>
          </Typography>
            Teknolojinin e˘gitimi d¨on¨u¸st¨urme g¨uc¨une inanarak, ¨o˘grencilere ve e˘gitmenlere yenilik¸ci ¸c¨oz¨umler sunmayı hedefliyorum.<br/>
            Universite e˘gitimim boyunca ¸ce¸sitli projelerde yer alarak e˘gitimde dijital d¨on¨u¸s¨um ¨uzerine ¨¸calı¸smalar yaptım <br/>
Ozellikle ¨o˘grenme y¨onetim sistemlerinin (LMS) kullanımı, interaktif i¸cerik geli¸stirme ¨ ve veri analiti˘gi ile ¨o˘grenme s¨ure¸clerini iyile¸stirme konularında kendimi geli¸stirdim.<br/>
Ekip ¸calı¸smasına b¨uy¨ukde˘ger verir, ele¸stirilere a¸cık bir ¸sekilde s¨urekli ¨o˘grenme arzusu i¸cindeyim <br/>


          <Box
            onClick={() => window.open('mailto:yakupsimseke@gmail.com')}
            sx={{
              display: 'flex',
              alignItems: 'center',
              gap: 1,
              px: 2,
              py: 1,
              bgcolor: '#d9f2e6',
              borderRadius: 2,
              cursor: 'pointer',
              width: 'fit-content',
              '&:hover': {
                bgcolor: '#b3e6cc',
              },
            }}
          >
            <MailOutlineIcon sx={{ color: '#007a33' }} />
            <Typography variant="body1" sx={{ fontWeight: 600, color: '#007a33' }}>
              Benimle İletişime Geçin
            </Typography>
            <ArrowForwardIosIcon sx={{ fontSize: 16, color: '#007a33' }} />
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default About;
